    name: 'beginCreateOrUpdate(string, string, string, ServerKey, Object)'
    children: []
    type: method
    langs:
      - typeScript
    summary: Creates or updates a server key.
    syntax:
      content: >-
        function beginCreateOrUpdate(resourceGroupName: string, serverName:
        string, keyName: string, parameters: ServerKey, options?: Object)
      parameters:
        - id: resourceGroupName
          type:
            - string
          description: >
            The name of the resource group that

            contains the resource. You can obtain this value from the Azure
            Resource

            Manager API or the portal.
        - id: serverName
          type:
            - string
          description: |
            The name of the server.
        - id: keyName
          type:
            - string
          description: >
            The name of the server key to be operated on

            (updated or created). The key name is required to be in the format
            of

            'vault_key_version'. For example, if the keyId is

            https://YourVaultName.vault.azure.net/keys/YourKeyName/01234567890123456789012345678901,

            then the server key name should be formatted as:

            YourVaultName_YourKeyName_01234567890123456789012345678901
        - id: parameters
          type:
            - azure-arm-sql.ServerKey
          description: |
            The requested server key resource state.
        - id: options
          type:
            - Object
          description: ''
          optional: true
      return:
        type:
          - Promise<azure-arm-sql.ServerKey>
    package: azure-arm-sql
